ll the best and latest official music videos, behind the scenes and live performances.  \nhttp://bit.ly/SubscribeToEdSheeran \n \nSee more official videos from Ed Sheeran here: \nhttps://www.youtube.com/watch?v=ryJgDL9jzKk\u0026list=PLjp0AEEJ0-fGKG_3skl0e1FQlJfnx-TJz \n\nListen to more from the album ÷ (divide): https://www.youtube.com/playlist?list=PLjp0AEEJ0-fGi7bkjrGhBLUF9NMraL9cL \n \nFollow Ed Sheeran on: \nInstagram: http://instagram.com/teddysphotos\nTikTok: https://www.tiktok.com/@edsheeran\nFacebook: http://www.facebook.com/EdSheeranMusic\nTwitter: http://twitter.com/edsheeran\nDiscord: http://discord.gg/edsheeran\nOfficial Website: http://edsheeran.com \n  \nVIDEO CREDITS: \n \nDirector | dp Jason Koenig  \nProducer: Honna Kimmerer  \nStarring: Ed Sheeran \u0026 Zoey Deutch  \nDirector of Photography: Johnny Valencia  \nProduction Company: Anonymous Content  \nExec Producer: Nina Soriano  \nProduction Manager: Doug Hoff  \nCommissioner: Dan Curwin  \nProduction Designer: John Lavin  \nLead Casting: Amy Hubbard  \nWritten by: Jason Koenig, Ed Sheeran, Jenny Koenig, Andrew Kolvet, Murray Cummings  \nEdited by: Jason Koenig \u0026 Johnny Valencia  \nVFX: Ian Hubert  \nGraphic design by Chris Ballasciotes  \nCast: Bo Valencia, Dennis Ranalta, Arthur Pauli  \nSki Cinematography: Corey Koniniec  \nSpecialty Camera op: Ryan Haug  \n1st AC: Ryan Brown  \n1st Assistant Director: Ole Zapatka  \nArt Director: Klaus Hartl  \nSnow fx: Lucien Stephenson  \nGaffer: Thomas Berz  \nStylist: Claudia Lajda  \nHair \u0026 Makeup: Christel Thoresen  \nAustrian Casting: Ursula Kiplinger  \nAdditional VFX: Zoic   \n\nSpecial Thanks to: The Hintertux Glacier, Austria; Hohenhaus Tenne, and Hotel Neuhintertux \n \nAbout Ed Sheeran: \nEd Sheeran may be the quintessential pop star of the 2010s: an internationally acclaimed, multi-award winning singer/songwriter who seems to acknowledge no boundaries between styles or eras with elements of folk, hip-hop, pop, dance, soul, and rock woven throughout his music. \n\nHis incredible catalogue includes the studio albums ‘+’ (plus), ‘x’ (multiply) and ‘÷’ (divide) which spawned hit singles such as ‘The A team’ , ’Lego House’, ‘Sing', ‘Thinking Out Loud’, ‘Photograph’, ‘Shape Of You’, ‘Castle on The Hill’ and ‘Perfect’. \n \nIn 2019, Ed Sheeran released the genre-spanning ‘No.6 Collaborations Project’ which featured a wide-range of artists including ‘Justin Bieber’, ‘Camilla’ Cabello’, ‘Travis Scott’, ‘Eminem’, ‘Cardi B, ‘Paulo Londra’, ‘Bruno Mars’ and ‘Stormzy’ amongst many others, producing hits such as ‘I Don’t Care’, ‘Beautiful People’, ‘South of The Border’ and ‘Take Me Back To London’. \n \n#EdSheeran #Perfect #divide","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/2Vv-BfVoq4g/hqdefault.jpg?sqp=-oaymwEbCKgBEF5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLA10odJyg6t041gxMu8v-6iUhbuQQ","width":168,"height":94},{"url":"https://i.ytimg.com/vi/2Vv-BfVoq4g/hqdefault.jpg?sqp=-oaymwEbCMQBEG5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLAvk-LijOC3ViffEtz33OPdAGoONw","width":196,"height":110},{"url":"https://i.ytimg.com/vi/2Vv-BfVoq4g/hqdefault.jpg?sqp=-oaymwEcCPYBEIoBSFXyq4qpAw4IARUAAIhCGAFwAcABBg==\u0026rs=AOn4CLD9ZlkAlL3Uhto1DlxyLO-lWQe8TA","width":246,"height":138},{"url":"https://i.ytimg.com/vi/2Vv-BfVoq4g/hqdefault.jpg?sqp=-oaymwEcCNACELwBSFXyq4qpAw4IARUAAIhCGAFwAcABBg==\u0026rs=AOn4CLCLtYBwO0_7u3WciwGy6gOCDq8lxw","width":336,"height":188}]},"allowRatings":true,"viewCount":"3828561568","author":"Ed Sheeran","isPrivate":false,"isUnpluggedCorpus":false,"isLiveContent":false},"annotations":[{"playerAnnotationsExpandedRenderer":{"featuredChannel":{"startTimeMs":"5000","endTimeMs":"259000","watermark":{"thumbnails":[{"url":"https://i.ytimg.com/an/0C-w0YjGpqDXGB8IHb662A/featured_channel.jpg?v=588f61b3","width":41,"height":38}]},"trackingParams":"CEwQ8zciEwjngrqwv7aJAxUJxXMBHfC3LNQ=","navigationEndpoint":{"clickTrackingParams":"CEwQ8zciEwjngrqwv7aJAxUJxXMBHfC3LNQyAml2","commandMetad  Music Video)"},"description":{"simpleText":"The official music video for Ed Sheeran - Perfect \nSubtract, the new album, out 05.05.2023. Pre-order: https://es.lnk.to/subtract\n \nTaken from the studio album ÷ (divide) released in 2017, which featured the hit singles 'Castle on the Hill', 'Shape of You', 'Galway Girl', ‘Perfect’ \u0026 'Happier'. \n \nSubscribe to the Ed Sheeran channel for all the best and latest official music videos, behind the scenes and live performances.  \nhttp://bit.ly/SubscribeToEdSheeran \n \nSee more official videos from Ed Sheeran here: \nhttps://www.youtube.com/watch?v=ryJgDL9jzKk\u0026list=PLjp0AEEJ0-fGKG_3skl0e1FQlJfnx-TJz \n\nListen to more from the album ÷ (divide): https://www.youtube.com/playlist?list=PLjp0AEEJ0-fGi7bkjrGhBLUF9NMraL9cL \n \nFollow Ed Sheeran on: \nInstagram: http://instagram.com/teddysphotos\nTikTok: https://www.tiktok.com/@edsheeran\nFacebook: http://www.facebook.com/EdSheeranMusic\nTwitter: http://twitter.com/edsheeran\nDiscord: http://discord.gg/edsheeran\nOfficial Website: http://edsheeran.com \n  \nVIDEO CREDITS: \n \nDirector | dp Jason Koenig  \nProducer: Honna Kimmerer  \nStarring: Ed Sheeran \u0026 Zoey Deutch  \nDirector of Photography: Johnny Valencia  \nProduction Company: Anonymous Content  \nExec Producer: Nina Soriano  \nProduction Manager: Doug Hoff  \nCommissioner: Dan Curwin  \nProduction Designer: John Lavin  \nLead Casting: Amy Hubbard  \nWritten by: Jason Koenig, Ed Sheeran, Jenny Koenig, Andrew Kolvet, Murray Cummings  \nEdited by: Jason Koenig \u0026 Johnny Valencia  \nVFX: Ian Hubert  \nGraphic design by Chris Ballasciotes  \nCast: Bo Valencia, Dennis Ranalta, Arthur Pauli  \nSki Cinematography: Corey Koniniec  \nSpecialty Camera op: Ryan Haug  \n1st AC: Ryan Brown  \n1st Assistant Director: Ole Zapatka  \nArt Director: Klaus Hartl  \nSnow fx: Lucien Stephenson  \nGaffer: Thomas Berz  \nStylist: Claudia Lajda  \nHair \u0026 Makeup: Christel Thoresen  \nAustrian Casting: Ursula Kiplinger  \nAdditional VFX: Zoic   \n\nSpecial Thanks to: The Hintertux Glacier, Austria; Hohenhaus Tenne, and Hotel Neuhintertux \n \nAbout Ed Sheeran: \nEd Sheeran may be the quintessential pop star of the 2010s: an internationally acclaimed, multi-award winning singer/songwriter who seems to acknowledge no boundaries between styles or eras with elements of folk, hip-hop, pop, dance, soul, and rock woven throughout his music. \n\nHis incredible catalogue includes the studio albums ‘+’ (plus), ‘x’ (multiply) and ‘÷’ (divide) which spawned hit singles such as ‘The A team’ , ’Lego House’, ‘Sing', ‘Thinking Out Loud’, ‘Photograph’, ‘Shape Of You’, ‘Castle on The Hill’ and ‘Perfect’. \n \nIn 2019, Ed Sheeran released the genre-spanning ‘No.6 Collaborations Project’ which featured a wide-range of artists including ‘Justin Bieber’, ‘Camilla’ Cabello’, ‘Travis Scott’, ‘Eminem’, ‘Cardi B, ‘Paulo Londra’, ‘Bruno Mars’ and ‘Stormzy’ amongst many others, producing hits such as ‘I Don’t Care’, ‘Beautiful People’, ‘South of The Border’ and ‘Take Me Back To London’. \n \n#EdSheeran #Perfect #divide"},"lengthSeconds":"280","ownerProfileUrl":"http://www.youtube.com/@EdSheeran","externalChannelId":"UC0C-w0YjGpqDXGB8IHb662A","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME","MF","MG","MH","MK","ML","MM","MN","MO","M LessText":{"simpleText":"Show less"},"attributedDescriptionBodyText":{"content":"The official music video for Ed Sheeran - Perfect \nSubtract, the new album, out 05.05.2023. Pre-order: https://es.lnk.to/subtract\n \nTaken from the studio album ÷ (divide) released in 2017, which featured the hit singles 'Castle on the Hill', 'Shape of You', 'Galway Girl', ‘Perfect’ \u0026 'Happier'. \n \nSubscribe to the Ed Sheeran channel for all the best and latest official music videos, behind the scenes and live performances.  \nhttp://bit.ly/SubscribeToEdSheeran \n \nSee more official videos from Ed Sheeran here: \n   • Ed Sheeran - Put It All On Me (feat. ...   \n\nListen to more from the album ÷ (divide):    • Ed Sheeran ÷ (divide)   \n \nFollow Ed Sheeran on: \nInstagram:   / teddysphotos  \nTikTok:   / edsheeran  \nFacebook:   / edsheeranmusic  \nTwitter:   / edsheeran  \nDiscord:   / discord  \nOfficial Website: http://edsheeran.com \n  \nVIDEO CREDITS: \n \nDirector | dp Jason Koenig  \nProducer: Honna Kimmerer  \nStarring: Ed Sheeran \u0026 Zoey Deutch  \nDirector of Photography: Johnny Valencia  \nProduction Company: Anonymous Content  \nExec Producer: Nina Soriano  \nProduction Manager: Doug Hoff  \nCommissioner: Dan Curwin  \nProduction Designer: John Lavin  \nLead Casting: Amy Hubbard  \nWritten by: Jason Koenig, Ed Sheeran, Jenny Koenig, Andrew Kolvet, Murray Cummings  \nEdited by: Jason Koenig \u0026 Johnny Valencia  \nVFX: Ian Hubert  \nGraphic design by Chris Ballasciotes  \nCast: Bo Valencia, Dennis Ranalta, Arthur Pauli  \nSki Cinematography: Corey Koniniec  \nSpecialty Camera op: Ryan Haug  \n1st AC: Ryan Brown  \n1st Assistant Director: Ole Zapatka  \nArt Director: Klaus Hartl  \nSnow fx: Lucien Stephenson  \nGaffer: Thomas Berz  \nStylist: Claudia Lajda  \nHair \u0026 Makeup: Christel Thoresen  \nAustrian Casting: Ursula Kiplinger  \nAdditional VFX: Zoic   \n\nSpecial Thanks to: The Hintertux Glacier, Austria; Hohenhaus Tenne, and Hotel Neuhintertux \n \nAbout Ed Sheeran: \nEd Sheeran may be the quintessential pop star of the 2010s: an internationally acclaimed, multi-award winning singer/songwriter who seems to acknowledge no boundaries between styles or eras with elements of folk, hip-hop, pop, dance, soul, and rock woven throughout his music. \n\nHis incredible catalogue includes the studio albums ‘+’ (plus), ‘x’ (multiply) and ‘÷’ (divide) which spawned hit singles such as ‘The A team’ , ’Lego House’, ‘Sing', ‘Thinking Out Loud’, ‘Photograph’, ‘Shape Of You’, ‘Castle on The Hill’ and ‘Perfect’. \n \nIn 2019, Ed Sheeran released the genre-spanning ‘No.6 Collaborations Project’ which featured a wide-range of artists including ‘Justin Bieber’, ‘Camilla’ Cabello’, ‘Travis Scott’, ‘Eminem’, ‘Cardi B, ‘Paulo Londra’, ‘Bruno Mars’ and ‘Stormzy’ amongst many others, producing hits such as ‘I Don’t Care’, ‘Beautiful People’, ‘South of The Border’ and ‘Take Me Back To London’. \n \n#EdSheeran #Perfect #divide","commandRuns":[{"startIndex":103,"length":26,"onTap":{"innertubeCommand":{"clickTrackingParams":"CCUQ040EGAgiEwjRmbqwv7aJAxWRVp0JHX39FSFIiNeiq9_A_63ZAQ==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbXQtQTlWV1k0ZVg2LU14TGVpQ0VjOGNmR0dKUXxBQ3Jtc0trSnZ3RmFDTTVYSkRfbDNGMm9qTGZOMTU1bVVKS2NwVWlZYXlJN3ZhS1c2Zlg2UDNHbERPemluR3hLU0txUmc3UTRDSUp5Z1RvLUNTLW1RNC1xS012RGxXTlIyVzd1Q1M5VUtqYm9jb0FHS2E2QnZzYw\u0026q=https%3A%2F%2Fes.lnk.to%2Fsubtract\u0026v=2Vv-BfVoq4g","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbXQtQTlWV1k0ZVg2LU14TGVpQ0VjOGNmR0dKUXxBQ3Jtc0trSnZ3RmFDTTVYSkRfbDNGMm9qTGZOMTU1bVVKS2NwVWlZYXlJN3ZhS1c2Zlg2UDNHbERPemluR3hLU0txUmc3UTRDSUp5Z1RvLUNTLW1RNC1xS012RGxXTlIyVzd1Q1M5VUtqYm9jb0FHS2E2QnZzYw\u0026q=https%3A%2F%2Fes.lnk.to%2Fsubtract\u0026v=2Vv-BfVoq4g","target":"TARGET_NEW_WINDOW","nofollow":true}}}},{"startIndex":429,"l
